        "rek_description": "Purpose of SPR Perspectives Reviews: Address contemporary scientific issues and controversies by leveraging the expertise of SPR membersIncrease SPR member engagement with the journalPair established and younger SPR members to simultaneously increase interaction between SPR members and create opportunities for mentorship The intranasal Live Attenuated Influenza Vaccine (LAIV), FluMist, has been widely appreciated by pediatricians, parents and children alike for its ease of administration. Concerns regarding lack of effectiveness in recent influenza seasons, however, led to the CDC Advisory Committee on Immunization Practices (ACIP) recommendation to administer inactivated influenza vaccines (IIV), and not LAIV, during the 2016-17 and 2017-18 seasons. Given that data from previous years demonstrated equivalent and even improved efficacy of LAIV compared with IIV, this recent data was surprising, raising many questions about potential mechanisms underlying this change. This review seeks to summarize the history of LAIV studies and ACIP recommendations with a focus on the recent decrease in vaccine effectiveness (VE) and discordant results among studies performed in different countries. Decreased VE for A\/H1N1pdm09 viruses represents the most consistent finding across studies, as VE has been low every season these viruses predominated since 2010-11. Potential explanations underlying diminished effectiveness include the hypothesis that prior vaccination, reduced thermostability of A\/H1N1pdm09, addition of a fourth virus, or reduced replication fitness of A\/H1N1pdm09 strains may have contributed to this phenomenon. Ongoing studies and potential alterations to LAIV formulations provide hope for a return of effective LAIV in future influenza seasons.Pediatric Research accepted article preview online, 25 September 2017. doi:10.1038\/pr.2017.239.",
